【結果はコントロールできない】
当たり前の話だが終わってしまったこと、過ぎ去ってしまった過去、つまり結果というのは自分ではコントロールできない。
これは、どうあがいても無理でしょう。
例えば、学校のテストで目標点数を達成できなかった時。
そのテストの結果をいくら見返したところで、点数が上がったりしませんよね？
なのに多くの人は、これと同じようなことをしています。
これを読んでいるあなたにも、このような経験はありませんか？
終わってしまった過去、結果に対して嘆き、引きずって悩む行為。
これは全くもって意味がないです。
.
.
【どこに目を向けるかが重要】
では、どうすればいいか？
結果に目を向けることも大事だが、基本的には行動自体に目を向けることが重要。
まず結果は変えられないということを受け入れ、その上で何ができるかを考え行動することが大切です。
結果はコントロールできなくても、結果を出すための行動はでき、またそれをコントロールすることも可能です。
.
.
【最後に】
結果は変えられないということを踏まえて、行動できる部分にフォーカスをあて、結果を得るための行動を起こしていきましょう。
.
